import React, { useEffect, useState } from "react";
import "../App.css";

const Home = () => {
  const [news, setNew] = useState(null);
  const fetch = require("node-fetch");

  const url =
    "https://free-news.p.rapidapi.com/v1/search?q=Elon%20Musk&lang=en";

  const options = {
    method: "GET",
    headers: {
      "X-RapidAPI-Key": "95270d40a5msha8409ac0ff32282p168b7cjsn2de68b8eb4fa",
      "X-RapidAPI-Host": "free-news.p.rapidapi.com",
    },
  };

  fetch(url, options)
    .then((res) => res.json())
    .then((json) => console.log(json))
    .catch((err) => console.error("error:" + err));

  return (
    <div className="row">
      <div className="col-3">sidebar</div>
      <div className="col-9">main content</div>
    </div>
  );
};

export default Home;
